import react from 'react'
import {View, Text, Button} from 'react-native'

/*Criar a tela 1*/
const Tela01 = () => {
    /*logica */
    return (
        <View>
            <Text> eu sou a tela 1</Text> 
            <Button
        title="TelaPrincipal"
        onPress={() => navigation.navigate('Tela01')}
      /> 
        </View>
        
    )
}

export default Tela01;
